import React from 'react';
import './InsertNumber.css';

function InsertNumber() {
    return (
        <div>
            <header className="header-insert">
                <p>Insert ur number</p>
                <p>ex:1,2,3,4,5,6</p>
            </header>

        </div>
    );
}

export default InsertNumber;
